import React, { useEffect, useState } from 'react';
import {
  MDBInput,
  MDBContainer,
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarToggler,
  MDBIcon,
  MDBNavbarNav,
  MDBNavbarItem,
  MDBNavbarLink,
  MDBBtn,
  MDBDropdown,
  MDBDropdownToggle,
  MDBDropdownMenu,
  MDBDropdownItem,
  MDBCollapse,
  MDBTableHead,
  MDBTableBody,
  MDBTable,
  MDBTextArea
} from 'mdb-react-ui-kit';
function App() {
  const [appointments, setAppointments] = useState([]);
  const [empData, setEmpData] = useState();


  const getAllData = async () => {
    try {
      const appointments = await fetch(
        `${process.env.REACT_APP_BASE_URL}/appointments`,
        {
          method: "GET",
          headers: {
            "Content-Type": "application/json",
          },
        }
      );

      const res = await appointments.json();
      console.log(res);
      setEmpData(res);
    } catch (error) {
      console.log(error);
    }
  };

  useEffect(() => {
    getAllData();
  }, []);
  console.log(empData);

  return (
    <div className='w-full max-w-[80%] mx-auto mt-12'>
      <h1 className='text-center mb-6'>Appointment Data</h1>

    <div className='flex flex-col items-start gap-8'>

    <MDBTable align='middle'>
    <MDBTableHead>
      <tr>
        <th scope='col'><p> Project ID</p></th>
        <th scope='col'><p>Client wallet address</p></th>
        <th scope='col'><p>Maximum Price</p></th>
        <th scope='col'><p>Project Details</p></th>


      </tr>
    </MDBTableHead>
    {empData?.data.map(appointment => {
        return (
          <MDBTableBody key={appointment._id}>
            <tr>
              <td>
                <div className='d-flex align-items-center'>
                  <div className='ms-3'>
                    <p className='fw-bold mb-1'>{appointment.lab}</p>
                  </div>
                </div>
              </td>
              <td>
                <p className='fw-normal mb-1'>{appointment.name}</p>
              </td>
              <td>
                <p>{appointment.email}</p>
              </td>
              <td>
                <div className='details'>
                  <p>{appointment.contact}</p>
                  </div>
              </td>
            </tr>
          </MDBTableBody>
        );
      })}
  </MDBTable>
      {/* fablab */}
      <table>
        <div>
        <thead>
          <tr>
            <th>Lab</th>
            <th>Name</th>
            <th>Email</th>
            <th>Contact</th>
            <th>Service</th>
            <th>Date</th>
          </tr>
        </thead>
        <tbody>
          {empData?.data.map(appointment => {
            if (appointment.lab === "FabLab") {
              return (
                <tr key={appointment._id}>
                  <td>{appointment.lab}</td>
                  <td>{appointment.name}</td>
                  <td>{appointment.email}</td>
                  <td>{appointment.contact}</td>
                  <td>{appointment.service}</td>
                  <td>{appointment.date}</td>
                </tr>
              );
            }
            return null; // Add this line if you want to skip rendering for other cases
          })}
        </tbody>
        </div>
      </table>

      {/* software */}
      <table>
        <thead>
          <tr>
            <th>Lab</th>
            <th>Name</th>
            <th>Email</th>
            <th>Contact</th>
            <th>Service</th>
            <th>Date</th>
          </tr>
        </thead>
        <tbody>
          {empData?.data.map(appointment => {
            if (appointment.lab === "Software") {
              return (
                <tr key={appointment._id}>
                  <td>{appointment.lab}</td>
                  <td>{appointment.name}</td>
                  <td>{appointment.email}</td>
                  <td>{appointment.contact}</td>
                  <td>{appointment.service}</td>
                  <td>{appointment.date}</td>
                </tr>
              );
            }
            return null; // Add this line if you want to skip rendering for other cases
          })}
        </tbody>

      </table>

      {/* industry 4.0 */}
      <table>
        <thead>
          <tr>
            <th>Lab</th>
            <th>Name</th>
            <th>Email</th>
            <th>Contact</th>
            <th>Service</th>
            <th>Date</th>
          </tr>
        </thead>
        <tbody>
          {empData?.data.map(appointment => {
            if (appointment.lab === "Industry4.0") {
              return (
                <tr key={appointment._id}>
                  <td>{appointment.lab}</td>
                  <td>{appointment.name}</td>
                  <td>{appointment.email}</td>
                  <td>{appointment.contact}</td>
                  <td>{appointment.service}</td>
                  <td>{appointment.date}</td>
                </tr>
              );
            }
            return null; // Add this line if you want to skip rendering for other cases
          })}
        </tbody>

      </table>
    </div>

    </div>
  );
}

export default App;
